import React from 'react';
import Toolbar from '../../toolbar/toolbar.js';
import Footer from '../../footer/footer.js';
import "./aboutpage.scss";

const Aboutpage = () => {
    return (
        <div className="aboutpage">
            <Toolbar />
            <div className="aboutpage-content">
            </div>
            <Footer />
        </div>
    );
}

export default Aboutpage;
